import React from 'react';

class MyStocks extends React.Component {
  render() {
    return(
      <div>
        <table>
          <tbody>
            <tr>
              <th>Hello</th>
              <th>kkk</th>
            </tr>
          </tbody>
          <tbody>
            <tr>
              <td>Ola</td>
              <td>hello</td>
            </tr>
          </tbody>
        </table>
      </div>
    )
  }
}

export default MyStocks;
